import React, { Component } from 'react';
import FormField from '../utils/Form/FormField';
import {update, generateData, isFormValid} from '../utils/Form/formActions'

import { connect } from 'react-redux';
import {  } from '../../actions/user_actions';

class Register extends Component {


    state = {
        formError: false,
        formSuccess: '',
        formdata: {
            name:{
                element: 'input',
                value: '',
                config: {
                    name: 'name_input',
                    type: 'text',
                    placeholder: 'Enter your name'
                },
                validation: {
                    required: true,
                },
                valid: false,
                touches: false,
                validationMessage: ''
            },
            lastname:{
                element: 'input',
                value: '',
                config: {
                    name: 'lastname_input',
                    type: 'text',
                    placeholder: 'Enter your lastname'
                },
                validation: {
                    required: true,
                },
                valid: false,
                touches: false,
                validationMessage: ''
            },
            email:{
                element: 'input',
                value: '',
                config: {
                    name: 'email_input',
                    type: 'email',
                    placeholder: 'Enter your email'
                },
                validation: {
                    required: true,
                    email: true
                },
                valid: false,
                touches: false,
                validationMessage: ''
            },
            password:{
                element: 'input',
                value: '',
                config: {
                    name: 'password_input',
                    type: 'password',
                    placeholder: 'Enter your password'
                },
                validation: {
                    required: true,
                },
                valid: false,
                touches: false,
                validationMessage: ''
            },
            confirmPassword:{
                element: 'input',
                value: '',
                config: {
                    name: 'confirm_password_input',
                    type: 'password',
                    placeholder: 'Confirm your password'
                },
                validation: {
                    required: true,
                    confirm: 'password'
                },
                valid: false,
                touches: false,
                validationMessage: ''
            }
        }
    }

    render() {
        return (
            <div className="page_wrapper">
                <div className="container">
                    <div className="register_login_container">

                    </div>
                </div>
            </div>
        );
    }
}

export default connect()(Register);
